script: |
  super -f text -I q4065.spq | sort > q4065.out

inputs:
  - name: q4065.spq
    data: |
      SELECT - - 60 + - col1 * - col0 / ( cor0.col2 * + ( cor0.col2 ) ) + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q4065.out
    data: |
      124
      140
      63
